=4efc9f","config_width":320,"config_height":320},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/243357091_1770772183133411_1607900263717951768_n.jpg?stp=c0.180.1440.1440a_dst-jpg_e35_s480x480\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=111\u0026_nc_ohc=NkhT_yuMXwUAX_oO4Qz\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-yrInQU6WxWztzmV-V9QPYq5Zo0_pNhMWNITyVa9C2QA\u0026oe=62C5BD89\u0026_nc_sid=4efc9f","config_width":480,"config_height":480},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/243357091_1770772183133411_1607900263717951768_n.jpg?stp=c0.180.1440.1440a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=111\u0026_nc_ohc=NkhT_yuMXwUAX_oO4Qz\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9x4JdVyGXKEg5s9vuLKbst_g3isYloorsph9EVq6endQ\u0026oe=62C5BD89\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":null}},{"node":{"__typename":"GraphImage","id":"2651051914746585607","edge_media_to_caption":{"edges":[{"node":{"text":"I got enrolled into PhD studies in the USA.\n\nIn fact, I've been overseas for almost two weeks already. I will be studying here the presence of microplastics in the natural environment, especially in snow in the high mountains (Sierra Nevada). So, a continuation of the research that I started with my master's thesis in Poland. I am doing my PhD for the Desert Resarch Institute and the University of Nevada in Reno.\n\nSome nice things, to Yosemite I have 3.5 hours drive, to Lake Tahoe, where one can find great climbing and skiing is just an hour :).\n\nReno is located in the desert, with almost no rain, but an average of 300 sunny days a year. There is nothing to complain about the lack of vitamin D here.\n\nI would like to thank all those who helped me and contributed to this path. To my family, friends, and academic staff at the University of Silesia, who instilled in me a curiosity for science.\n\nHow did it happen that I ended up in the USA? It was not an easy path - the story is described on my blog (link in the bio). Taking care of everything started in December last year.\n\nIf any of you is going to be in Reno area for the next 4 years, let me know, it'll be grat to see you ;)\n\n#studyintheusa\n#studyintheus\n#phdstudent #phdlife #science #scientist #microplastics #microplastic #desertresearchinstitute #universityofnevadareno #universityofnevada"}}]},"shortcode":"CTKbaurluIH","edge_media_to_comment":{"count":6},"taken_at_timestamp":1630250037,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/240845730_929235907623376_7751348473333769091_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=BmhdVyltOuwAX-s5-FH\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8X7TzTAOCcchtuPBsNd_YuFp09RpjEYU4Z6IxSDRcgwg\u0026oe=62C5C081\u0026_nc_sid=4efc9f","edge_liked_by":{"count":107},"edge_media_preview_like":{"count":107},"owner":{"id":"9243396379"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/240845730_929235907623376_7751348473333769091_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=BmhdVyltOuwAX-s5-FH\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9T3_hliUu6bdtcHK04fnpAa-1IQiryPr4i9XdlRlkFXw\u0026oe=62C5C081\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/240845730_929235907623376_7751348473333769091_n.jpg?stp=dst-jpg_e35_s150x150\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=BmhdVyltOuwAX-s5-FH\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8ItXe1b6WbOjbx0zKT7k-6hbjNI6J7h0kMpvhaKL5lRw\u0026oe=62C5C081\u0026_nc_sid=4efc9f","config_width":150,"config_height":150},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/240845730_929235907623376_7751348473333769091_n.jpg?stp=dst-jpg_e35_s240x240\u0026_nc_ht=